CREATE TABLE HallOfFame(
   playerID    VARCHAR(9) NOT NULL PRIMARY KEY
  ,yearid      INTEGER  NOT NULL
  ,votedBy     VARCHAR(16) NOT NULL
  ,ballots     INTEGER 
  ,needed      INTEGER 
  ,votes       INTEGER 
  ,inducted    VARCHAR(1) NOT NULL
  ,category    VARCHAR(17) NOT NULL
  ,needed_note VARCHAR(6)
);
